import Vue from 'vue';
import App from './App.vue';
import router from './router/js';
import store from './store/index.js'; // Ensure this line imports the store correctly

Vue.config.productionTip = false;

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app');
